import React, { useState } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import jsPDF from "jspdf";
import autoTable from "jspdf-autotable";
import logo from "./CIT_logo.png";

// You may set this to your own base64 string of the logo
const logoBase64 = "data:image/png;base64,";

function App() {
  const citDepartments = ["CIVIL", "EEE", "ECE", "MEC", "MCT", "BME", "IT", "AIDS", "AIML", "ACT", "VLSI"];
  const citarDepartments = ["CSE", "CSE-CS", "CSBS"];
  const citHalls = ["F8","F9","F22","F23","S1","S2","S3","S4","S5","S6","S7","S8","S10","S15","S16","S17","S18","S20","S21","S22","S23","S24","S26","S27","MS1","MS2","MS3","MS4","MS5","MS6","MS7","MS8","T2","T3","T4","T6","T7","T8","T9","T10","T11","T12","T13","T14"];
  const citarHalls = ["101","102","202","203","204","205","302","303","304","305","306","307","308","309","402","502","503","504","507","508","509","601","602","603","604","605","606","607","608"];
  const yearOptions = {
    CIT: ["1st", "2nd", "3rd", "CITAR-3rd", "4th"],
    CITAR: ["1st", "2nd", "3rd", "CITAR-3rd", "4th"]
  };
  const deptCodeMap = {
    CSE:"CS", IT:"IT", CIVIL:"CE", ECE:"EC", MEC:"ME", MCT:"MT", BME:"BM",
    AIDS:"AD", AIML:"AM", ACT:"AC", VLSI:"VL", CSBS:"CB", EEE:"EE", "CSE-CS":"CZ"
  };
  const [step, setStep] = useState(1);
  const [role, setRole] = useState("CIT");
  const [selectedHalls, setSelectedHalls] = useState([]);
  const [hallAssignments, setHallAssignments] = useState({});
  const [showAddMore, setShowAddMore] = useState({});
  const [addMoreSelection, setAddMoreSelection] = useState({});
  const [manualRollInput, setManualRollInput] = useState({});
  const [tableConfig, setTableConfig] = useState({}); // { hall: { rows: X, cols: Y } }

  const halls = role==="CIT" ? citHalls : citarHalls;
  const departments = role==="CIT" ? citDepartments : citarDepartments;

  const selectAllHalls = ()=>setSelectedHalls([...halls]);
  const toggleHall = hall=>{
    setSelectedHalls(prev => prev.includes(hall)? prev.filter(h=>h!==hall) : [...prev,hall]);
    if(selectedHalls.includes(hall)){
      setHallAssignments(prev=>{
        const copy = {...prev};
        delete copy[hall];
        return copy;
      });
    }
  };
  const toggleYearForHall = (hall, year)=>{
    setHallAssignments(prev=>{
      const prevYears = prev[hall]?.years||[];
      let newYears = prevYears.includes(year)? prevYears.filter(y=>y!==year) : [...prevYears, year];
      const prevYearDepartments = prev[hall]?.yearDepartments||{};
      if(!newYears.includes(year)) delete prevYearDepartments[year];
      // remove any rollRanges for that year if unselected
      const prevRollRanges = prev[hall]?.rollRanges || {};
      const newRollRanges = {...prevRollRanges};
      if(!newYears.includes(year)) delete newRollRanges[year];
      return {...prev, [hall]: {...(prev[hall]||{}), years:newYears, yearDepartments:{...prevYearDepartments}, rollRanges:{...newRollRanges}, extraStudents: prev[hall]?.extraStudents||[]}};
    });
  };
  const toggleDeptForHallYear = (hall, year, dept)=>{
    setHallAssignments(prev=>{
      const prevDeptForYear = prev[hall]?.yearDepartments?.[year]||[];
      const newDeptForYear = prevDeptForYear.includes(dept)? prevDeptForYear.filter(d=>d!==dept) : [...prevDeptForYear, dept];
      // Rollranges structure: { [year]: {[dept]: {start, end}} }
      const prevRollRanges = prev[hall]?.rollRanges || {};
      const newRollRanges = {...prevRollRanges};
      if(!newDeptForYear.includes(dept) && newRollRanges[year] && newRollRanges[year][dept]) {
        const copy = {...newRollRanges[year]};
        delete copy[dept];
        newRollRanges[year] = copy;
      }
      return {...prev, [hall]: {...(prev[hall]||{}), yearDepartments:{...(prev[hall]?.yearDepartments||{}), [year]: newDeptForYear}, years: prev[hall]?.years||[], rollRanges: newRollRanges, extraStudents: prev[hall]?.extraStudents||[]}};
    });
  };
  const handleRollRangeChange = (hall, year, dept, type, value)=>{
    setHallAssignments(prev=>{
      const prevRanges = prev[hall]?.rollRanges||{};
      const yearRanges = prevRanges[year]||{};
      const newDeptRange = {...yearRanges[dept], [type]: value};
      const newYearRanges = {...yearRanges, [dept]: newDeptRange};
      const newRollRanges = {...prevRanges, [year]: newYearRanges};
      return {...prev, [hall]: {...(prev[hall]||{}), rollRanges: newRollRanges, years: prev[hall]?.years||[], yearDepartments: prev[hall]?.yearDepartments||{}, extraStudents: prev[hall]?.extraStudents||[]}};
    });
  };

  const btnStyle = (active=false)=>({backgroundColor: active?"#28a745":"#FFD700", border:"2px solid #DAA520", color:"black", padding:"8px 16px", fontWeight:"bold", margin:"6px", borderRadius:"8px", cursor:"pointer"});
  const navBtn = {backgroundColor:"#FFD700", border:"2px solid #DAA520", color:"black", padding:"8px 16px", fontWeight:"bold", margin:"6px", borderRadius:"8px", cursor:"pointer"};

  const canNext = step===1 && selectedHalls.length>0;
  const handleNext = ()=>{if(canNext && step<2) setStep(step+1);}
  const handleBack = ()=>{if(step>1) setStep(step-1);}
  const getYearPrefix = (yearLabel, dept, role)=>{
    const yearCodeMap = {
      "1st":"25",
      "2nd":"24",
      "3rd":"23",
      "CITAR-3rd": role==="CITAR"?"40001":"23",
      "4th":"22"
    };
    const yearCode = yearCodeMap[yearLabel] || "XX";
    const deptCode = deptCodeMap[dept] || "XX";
    return `${yearCode}${deptCode}`;
  };

  // --- Add More Student ---
  const handleAddMoreStudent = (hall)=>{
    const sel = addMoreSelection[hall];
    if(!sel || !sel.year || !sel.dept) return;
    const manualRoll = manualRollInput[hall]?.trim();
    if(!manualRoll) return;
    const prefix = getYearPrefix(sel.year, sel.dept, role);
    const fullRoll = `${prefix}${manualRoll.padStart(4,"0")}`;
    setHallAssignments(prev=>{
      const prevExtra = prev[hall]?.extraStudents||[];
      return {...prev, [hall]: {...(prev[hall]||{}), extraStudents:[...prevExtra, {year: sel.year, dept: sel.dept, roll: fullRoll}] }};
    });
    setAddMoreSelection(prev=>({...prev, [hall]: {year:"", dept:""}}));
    setManualRollInput(prev=>({...prev, [hall]: ""}));
    setShowAddMore(prev=>({...prev, [hall]: false}));
  };
// --- Seating PDF ---
const generatePDF = () => {
  const doc = new jsPDF();
  doc.addImage(logoBase64, "PNG", 10, 8, 50, 25);
  selectedHalls.forEach((hall, hIndex) => {
    if (hIndex > 0) doc.addPage();
    doc.setFontSize(18);
    doc.text("Seating Arrangement", 105, 24, { align: "center" });
    doc.setFontSize(14);
    doc.text(`Hall: ${hall}`, 105, 34, { align: "center" });

    const hallData = hallAssignments[hall] || {};
    const students = [];

    (hallData.years || []).forEach((year) => {
      (hallData.yearDepartments?.[year] || []).forEach((dept) => {
        const deptRange = hallData.rollRanges?.[year]?.[dept];
        if (deptRange && deptRange.start && deptRange.end) {
          const prefix = getYearPrefix(year, dept, role);
          for (let i = parseInt(deptRange.start, 10); i <= parseInt(deptRange.end, 10); i++) {
            students.push({ roll: `${prefix}${String(i).padStart(4, "0")}`, year, dept });
          }
        }
      });
    });

    (hallData.extraStudents || []).forEach((s) => students.push({ roll: s.roll, year: s.year, dept: s.dept }));
    students.sort((a, b) => a.roll.localeCompare(b.roll));

    // Group by (year, dept)
    const groupMap = new Map();
    students.forEach(s => {
      const key = `${s.year}__${s.dept}`;
      if (!groupMap.has(key)) groupMap.set(key, []);
      groupMap.get(key).push(s);
    });

    // Convert map to array of queues
    const queues = [...groupMap.entries()].map(([key, arr]) => ({ key, arr: [...arr] }));

    const seatList = [];
    while (queues.some(q => q.arr.length > 0)) {
      // pick first available student from queue 0
      let firstStudent = null;
      let firstQueueIndex = -1;
      for (let i = 0; i < queues.length; i++) {
        if (queues[i].arr.length > 0) {
          firstStudent = queues[i].arr.shift();
          firstQueueIndex = i;
          break;
        }
      }
      if (!firstStudent) break;

      // find a student from queue different in year and dept from firstStudent
      let secondStudent = null;
      
      for (let i = 0; i < queues.length; i++) {
        if (i === firstQueueIndex) continue;
        if (queues[i].arr.length === 0) continue;

        const candidate = queues[i].arr[0];
        if (candidate.year !== firstStudent.year && candidate.dept !== firstStudent.dept) {
          secondStudent = queues[i].arr.shift();
        
          break;
        }
      }

    
      if (!secondStudent) {
        for (let i = 0; i < queues.length; i++) {
          if (i === firstQueueIndex) continue;
          if (queues[i].arr.length === 0) continue;
          const candidate = queues[i].arr;
          if (candidate.year !== firstStudent.year || candidate.dept !== firstStudent.dept) {
            secondStudent = queues[i].arr.shift();
            //secondQueueIndex = i;
            break;
          }
        }
      }

      // Push pair or single
      if (secondStudent) {
        seatList.push(`${firstStudent.roll}\n${secondStudent.roll}`);
      } else {
        seatList.push(firstStudent.roll);
      }
    }

    const rows = tableConfig[hall]?.rows || 6;
    const cols = tableConfig[hall]?.cols || 5;

    const grid = Array.from({ length: rows }, () => []);
    let seatIndex = 0;
    for (let c = 0; c < cols; c++) {
      if (c % 2 === 0) for (let r = 0; r < rows; r++) grid[r].push(seatList[seatIndex++] || "");
      else for (let r = rows - 1; r >= 0; r--) grid[r].push(seatList[seatIndex++] || "");
    }

    const snoGrid = Array.from({ length: rows }, () => Array(cols).fill(0));
    let serialCounter = 1;
    for (let c = 0; c < cols; c++) {
      if (c % 2 === 0) for (let r = 0; r < rows; r++) snoGrid[r][c] = serialCounter++;
      else for (let r = rows - 1; r >= 0; r--) snoGrid[r][c] = serialCounter++;
    }

    const tableHeaders = [];
    for (let i = 1; i <= cols; i++) {
      tableHeaders.push(`Row ${i}`);
      tableHeaders.push("S.No");
    }
    const tableBody = [];
    for (let r = 0; r < rows; r++) {
      const rowArr = [];
      for (let c = 0; c < cols; c++) {
        rowArr.push(grid[r][c]);
        rowArr.push(snoGrid[r][c].toString());
      }
      tableBody.push(rowArr);
    }

    autoTable(doc, {
      head: [tableHeaders],
      body: tableBody,
      startY: 50,
      theme: "grid",
      styles: { fontSize: 9, cellPadding: 2, valign: "middle" },
      headStyles: { fillColor: [240, 240, 240], textColor: [0, 0, 0], fontStyle: "bold" },
    });
  });
  doc.save("hall_seating_arrangement.pdf");
};


  // Notice Board PDF
  const generateNoticePDF = () => {
    const doc = new jsPDF();
    doc.addImage(logoBase64, "PNG", 10, 8, 50, 25);
    doc.setFontSize(16);
    doc.text(`${role} NOTICE BOARD`, 105, 20, { align: "center" });
    let startY = 30;
    yearOptions[role].forEach(year => {
      let yearHasData = false;
      selectedHalls.forEach(hall => {
        const hallData = hallAssignments[hall];
        if (!hallData) return;
        const deptsFromSelection = hallData.yearDepartments?.[year] || [];
        const deptsFromExtra = [...new Set((hallData.extraStudents || [])
          .filter(s => s.year === year)
          .map(s => s.dept))];
        const depts = [...new Set([...deptsFromSelection, ...deptsFromExtra])];
        depts.forEach(dept => {
          let students = [];
          // Collect roll numbers from range
          const deptRange = hallData.rollRanges?.[year]?.[dept];
          if (deptRange && deptRange.start && deptRange.end && deptsFromSelection.includes(dept)) {
            const prefix = getYearPrefix(year, dept, role);
            for (let i = parseInt(deptRange.start, 10); i <= parseInt(deptRange.end, 10); i++) {
              students.push(`${prefix}${String(i).padStart(4, "0")}`);
            }
          }
          // Collect extra students
          const extra = (hallData.extraStudents || []).filter(s => s.year === year && s.dept === dept);
          students = students.concat(extra.map(s => s.roll));
          if (students.length > 0) {
            if (!yearHasData) {
              doc.setFontSize(14);
              doc.text(`Year ${year}`, 105, startY, { align: "center" });
              startY += 7;
              yearHasData = true;
            }
            doc.setFontSize(12);
            doc.text(`Department: ${dept}`, 20, startY);
            startY += 5;
            const tableBody = [];
            let serial = 1;
            const startReg = students[0];
            const endReg = students[students.length - 1];
            const totalStrength = students.length;
            tableBody.push([serial, startReg, endReg, hall, totalStrength]);
            autoTable(doc, {
              startY: startY,
              head: [["S.No", "Starting Reg No", "Ending Reg No", "Hall No", "Total Strength"]],
              body: tableBody,
              theme: "grid",
              headStyles: { fillColor: [240, 240, 240], textColor: [0, 0, 0], fontStyle: "bold" },
              styles: { fontSize: 11, cellPadding: 2 }
            });
            startY = doc.lastAutoTable.finalY + 10;
          }
        });
      });
    });
    if (startY === 30) {
      doc.text("No halls or years selected.", 20, startY);
    }
    doc.save("notice_board.pdf");
  };

  return (
    <div className="container-fluid min-vh-100 py-5" style={{backgroundColor:"#001f3f", color:"white"}}>
      <img
        src={logo}
        alt="CIT Logo"
        style={{
          position: "absolute",
          top: "30px",
          right: "1300px",
          height: "100px",
          objectFit: "contain"
        }}
      />
      <h2 className="text-center mb-4">CHENNAI INSTITUTE OF TECHNOLOGY – SEATING ARRANGEMENT</h2>
      <div className="container mt-4">
        {/* Step 1 */}
        {step===1 && (
          <>
            <div className="mb-3">
              <label className="form-label">Choose Institution:</label>
              <select className="form-select" value={role} onChange={(e)=>{setRole(e.target.value); setSelectedHalls([]); setHallAssignments({}); setStep(1);}}>
                <option value="CIT">CIT</option>
                <option value="CITAR">CITAR</option>
              </select>
            </div>
            <h5>Select Halls:</h5>
            <div><button style={btnStyle()} onClick={selectAllHalls}>Select All</button></div>
            <div className="d-flex flex-wrap">{halls.map(hall=><button key={hall} style={btnStyle(selectedHalls.includes(hall))} onClick={()=>toggleHall(hall)}>{hall}</button>)}</div>
          </>
        )}
        {/* Step 2 */}
        {step===2 && selectedHalls.map(hall=>{
          const assignment = hallAssignments[hall]||{};
          const assignedYears = assignment.years||[];
          const yearDepartments = assignment.yearDepartments||{};
          const rollRanges = assignment.rollRanges||{};
          const rows = tableConfig[hall]?.rows || 6;
          const cols = tableConfig[hall]?.cols || 5;
          return (
            <div key={hall} className="mt-4 border p-3 rounded">
              <h5>Hall: {hall}</h5>
              <div className="d-flex mb-3">
                <input type="number" className="form-control me-2" placeholder="Rows" value={rows} min={1}
                  onChange={(e)=>setTableConfig(prev=>({...prev, [hall]: {...prev[hall], rows: parseInt(e.target.value)}}))}/>
                <input type="number" className="form-control" placeholder="Columns" value={cols} min={1}
                  onChange={(e)=>setTableConfig(prev=>({...prev, [hall]: {...prev[hall], cols: parseInt(e.target.value)}}))}/>
              </div>
              <strong>Select Years:</strong>
              <div className="d-flex flex-wrap mb-3">
                {yearOptions[role].map(yearLabel =>
                  <button
                    key={yearLabel}
                    style={btnStyle(assignedYears.includes(yearLabel))}
                    onClick={() => toggleYearForHall(hall, yearLabel)}>
                      {yearLabel}
                  </button>
                )}
              </div>
              {/* For each assigned year, show department selection and roll range for each selected department */}
              {assignedYears.map(yearLabel=>{
                const selectedDepts = yearDepartments[yearLabel]||[];
                const thisYearRollRanges = rollRanges[yearLabel]||{};
                return (
                  <div key={yearLabel} className="mb-3">
                    <strong>{yearLabel} Departments:</strong>
                    <div className="d-flex flex-wrap mb-2">
                      {departments.map(dept =>
                        <button
                          key={dept}
                          style={btnStyle(selectedDepts.includes(dept))}
                          onClick={()=>toggleDeptForHallYear(hall, yearLabel, dept)}
                        >
                          {dept}
                        </button>
                      )}
                    </div>
                    {/* For each selected department for this year, show its roll range entry boxes */}
                    {selectedDepts.map(dept=>(
                      <div key={dept} className="d-flex mb-2 align-items-center">
                        <span style={{width: "100px"}}>{dept} roll range:</span>
                        <input type="number" className="form-control me-2" placeholder="Start Roll" style={{width:"120px"}}
                          value={thisYearRollRanges[dept]?.start||""}
                          onChange={(e)=>handleRollRangeChange(hall, yearLabel, dept, "start", e.target.value)}/>
                        <input type="number" className="form-control me-2" placeholder="End Roll" style={{width:"120px"}}
                          value={thisYearRollRanges[dept]?.end||""}
                          onChange={(e)=>handleRollRangeChange(hall, yearLabel, dept, "end", e.target.value)}/>
                      </div>
                    ))}
                  </div>
                )
              })}
              {showAddMore[hall] && (
                <div className="border p-2 mb-2 rounded">
                  <select className="form-select mb-2" value={addMoreSelection[hall]?.year||""} onChange={(e)=>setAddMoreSelection(prev=>({...prev,[hall]:{...prev[hall],year:e.target.value}}))}>
                    <option value="">Select Year</option>
                    {yearOptions[role].map(y=><option key={y} value={y}>{y}</option>)}
                  </select>
                  <select className="form-select mb-2" value={addMoreSelection[hall]?.dept||""} onChange={(e)=>setAddMoreSelection(prev=>({...prev,[hall]:{...prev[hall],dept:e.target.value}}))}>
                    <option value="">Select Dept</option>
                    {departments.map(d=><option key={d} value={d}>{d}</option>)}
                  </select>
                  <input type="number" className="form-control mb-2" placeholder="Manual Roll Number" value={manualRollInput[hall]||""} onChange={(e)=>setManualRollInput(prev=>({...prev,[hall]: e.target.value}))}/>
                  <button className="btn btn-success" onClick={()=>handleAddMoreStudent(hall)}>Add Student</button>
                </div>
              )}
              <button className="btn btn-warning mb-2" onClick={()=>setShowAddMore(prev=>({...prev,[hall]:!prev[hall]}))}>{showAddMore[hall]?"Hide Add More":"Add More Students"}</button>
            </div>
          )
        })}
        <div className="mt-4">
          {step>1 && <button style={navBtn} onClick={handleBack}>Back</button>}
          {step<2 && <button style={navBtn} onClick={handleNext} disabled={!canNext}>Next</button>}
        </div>
        {step===2 && <div className="mt-4">
          <button style={navBtn} onClick={generatePDF}>Generate Seating PDF</button>
          <button style={btnStyle()} onClick={generateNoticePDF}>Download Notice PDF</button>
        </div>}
      </div>
    </div>
  );
}

export default App;
